INSERT INTO `app_article` VALUES (64,'aczeki','Propozycje kategorii','Zastanawiam siÄ™ nad zamkniÄ™ciem forum tylko dla osÃ³b zarejestrowanych? \n\nCo wy na to ?','FORUM INFORMACYJNE','Tematy do obgadania'),(65,'A/monika','Propozycje kategorii','HEj!Nie uwazam tego za dobry pomysl,dlatego,ze wiele ludzi szperajacych na necie nie lubi sie logowac ,zeby miec dostep do informacji i to moze byc powod ,ze beda omijac ta stronke.Ale jezeli chodzi o album -to jestem za.W to miejsce powinni miec dostep tylko uzytkownicy.Ale to jest moje zdanie.Wszystko zalezy od tego jak Ty sam to widzisz.','FORUM INFORMACYJNE','Tematy do obgadania'),(66,'Marta','Propozycje kategorii','Witam! No wÅ‚aÅ›nie mam takie pytanie, czy zdjÄ™cia bÄ™dÄ… dostÄ™pne dla wszystkich, nawet postronnych osÃ³b, czy album bedzie dziaÅ‚aÅ‚ tak jak do tej pory? Nie chciaÅ‚abym aby przypadkowe osoby oglÄ…daÅ‚y zdjÄ™cia mojej niuni. Pozdrawiam!','FORUM INFORMACYJNE','Tematy do obgadania'),(67,'karolinaklara','Propozycje kategorii','zaÅ‚oÅ¼enie jest takie, Å¼eby album byÅ‚ tylko dla wtajemniczonych  \n\n\n__________________________________________________\n\nchwalÄ™ ale jak trzeba ganiÄ™, taka rola administratora','FORUM INFORMACYJNE','Tematy do obgadania'),(68,'Guest','Propozycje kategorii','Mam inne trochÄ™ pytanko;-) ZarejestrowaÄ‡ siÄ™ mogÄ… wszyscy tak? Czyli kaÅ¼dy w zasadzie moze zobaczyÄ‡ zdjÄ™cia, ktÃ³re tutaj bÄ™dÄ… dodane. Moze jakieÅ› zabezpieczenie daÅ‚o by sie wprowadziÄ‡, podobne jak do tej pory.','FORUM INFORMACYJNE','Tematy do obgadania'),(69,'A/monika_lwo','Propozycje kategorii','To byÅ‚am ja, wylogowaÅ‚o mnie   \n\n\n_________________MÃ³j Album','FORUM INFORMACYJNE','Tematy do obgadania'),(70,'A/monika_lwo','Propozycje kategorii','karolinaklara wrote:   zaÅ‚oÅ¼enie jest takie, Å¼eby album byÅ‚ tylko dla wtajemniczonych   \n\n\nCzyli jak tego dokonaÄ‡;-)?','FORUM INFORMACYJNE','Tematy do obgadania'),(71,'karolinaklara','Propozycje kategorii','Podobnie jak na gazeta pl trzeba dostaÄ‡ uprawnienia od administratora -w tym przypadku   admin musi nadaÄ‡ uprawnienia do peÅ‚nego forum. Jako goÅ›Ä‡ moÅ¼e uczestniczyÄ‡ na forum, ale nie widzi albumu.\n\n\n__________________________________________________\n\nchwalÄ™ ale jak trzeba ganiÄ™, taka rola administratora','FORUM INFORMACYJNE','Tematy do obgadania'),(72,'Olga','Propozycje kategorii','Tez jestem za zamknieciem albumu czyli tylko dla osob lub rodzicow dzieci z naczyniakami. Podzial najlepiej taki jak w starym albumie:\n\nnaczyniaki plaskie\n\nnaczyniaki jamiste\n\npocalunki aniolka, uszczypniecia bociana\n\nniesklasyfikowane','FORUM INFORMACYJNE','Tematy do obgadania'),(73,'A/monika','Propozycje kategorii','Ja jak szukalam info na temat naczyniakow na necie to znajdowalam malo stron dotyczacych tego tematu,a na pewno malo precyzyjnych.Na amerykanskich srtonach mozna bylo znalezc baaaaaaaardzo duzo tego.Nie wiem ,moze mialam malo szczescia co do wynajdowania informacji na ten temat,dlatego uwazam ze fajnie by bylo gdyby mozna bylo sie podzielic ciekawymi linkami z innymi.','FORUM INFORMACYJNE','Tematy do obgadania'),(74,'aczeki','Propozycje kategorii','postaram siÄ™ w najbliÅ¼szych dniach zrobiÄ‡ coÅ› z dostÄ™pami do albumÃ³w, moÅ¼e rozwiÄ…zaniem bÄ™dzie ograniczenie dostÄ™pu dla osÃ³b, ktÃ³re majÄ… faktycznie problem z naczyniakami i przeszÅ‚y weryfikacjÄ™ przez karolinaklarÄ™','FORUM INFORMACYJNE','Tematy do obgadania'),(75,'Olga','Propozycje kategorii','Proponuje umiescic na gorze jako osobny watek, liste lekarzy zajmujacych sie naczyniakami w calej Polsce. Kazdy kto znajdzie sie na tym forum bedzie mogl zobaczyc czy polecany lekarz znajduje sie w jego okolicy.\n\nNajlepiej uporzadkowac taka liste zaczynajac od podania miasta, pozniej nazwisko lekarza. Osoby, ktore polecaja takiego lekarza moglyby dodac swoja opinie.\n\nMozna tez zrobic liste laserow dostepnych w Polsce, dzielac je na lasery , ktore pomagaja przy naczyniakach jamistych i plaskich.','FORUM INFORMACYJNE','Tematy do obgadania'),(76,'Guest','Propozycje kategorii','[quote]Zastanawiam siÄ™ nad zamkniÄ™ciem forum tylko dla osÃ³b zarejestrowanych?\n\nCo wy na to ?[/quote]\n\n\njestem za   forum zamkniÄ™te ma oczywiÅ›cie swoje wady, ale myÅ›lÄ™, Å¼e zalet jest wiÄ™cej\n\n\n[quote=\"monika\"]wiele ludzi szperajacych na necie nie lubi sie logowac ,zeby miec dostep do informacji[/quote]\n\n\njasne, ale zabawa w forum polega na wymianie doÅ›wiadczeÅ„ i jest fajnie, kiedy kaÅ¼dy czÅ‚onek okaÅ¼e jakieÅ›tam zaangaÅ¼owanie. poza tym rejestracja zapewnia minimum intymnoÅ›ci - na pewno wiÄ™kszoÅ›Ä‡ rodzicÃ³w bÄ™dzie siÄ™ czuÅ‚a lepiej, kiedy bÄ™dzie mogÅ‚a siÄ™  podzieliÄ‡ chorobÄ… swoich dzieci z okreÅ›lonÄ… grupÄ… wtajemniczonych uÅ¼ytkownikÃ³w, a nie z kaÅ¼dym, kto przypadkiem trafi na te stronÄ™.\n\n\nw ten sposÃ³b Å‚atwiej tworzÄ… sie spoÅ‚ecznoÅ›ci, a byÅ‚oby miÅ‚o, gdyby taka spoÅ‚ecznoÅ›Ä‡ tutaj powstaÅ‚a \n\n\nale to takie tylko moje zdanie','FORUM INFORMACYJNE','Tematy do obgadania'),(77,'A/arcarsenal','Propozycje kategorii','... a to pisaÅ‚am ja - wylogowana \n\n\nco do albumu: w razie gdyby miaÅ‚o to byÄ‡ forum zamkniÄ™te moÅ¼na dodatkowo ograniczyÄ‡ dostÄ™pnoÅ›Ä‡ albumu, przez stworzenie grupy uÅ¼ytkownikÃ³w uprzywilejowanych. wtedy juÅ¼ w ogÃ³le byÅ‚by porzÄ…dek i na pewno nikt niepowoÅ‚any nie mÃ³gÅ‚by oglÄ…daÄ‡ zdjÄ™Ä‡ \n\n\nco do nowych dziaÅ‚Ã³w: nasze przypadki - czy coÅ› w tym stylu - z przeznaczeniem do opisu naszych naczyniakÃ³w i historii leczenia, zaznaczania postÄ™pÃ³w   a na poczÄ…tek moÅ¼e witamy siÄ™ - kulturalnie jest powiedzieÄ‡ dzieÅ„ dobry  \n\n\nLast edited by arcarsenal on 2007-04-04, 20:28; edited 1 time in total','FORUM INFORMACYJNE','Tematy do obgadania'),(78,'karolinaklara','Propozycje kategorii','CieszÄ™ siÄ™, Å¼e jest juÅ¼ pewne zainteresowanie tÄ… stronÄ… :) tak jak pisaÅ‚am wyÅ¼ej, album jest zabezpieczony  trzeba dostaÄ‡ dodatkowe uprawnienia  moÅ¼emy siÄ™ jednak zastanowiÄ‡, czy to wystarczy. Co do przypadkÃ³w, to staraÅ‚am siÄ™ tak porozbijaÄ‡ tematy, Å¼eby uÅ‚atwiÄ‡ kategoryzacjÄ™ problemu jaki nas dotyka.\n\n\n__________________________________________________\n\nchwalÄ™ ale jak trzeba ganiÄ™, taka rola administratora','FORUM INFORMACYJNE','Tematy do obgadania');
