\nDodatkowo na ramiomionku ma tzw.teleangiektazje.\r\nObecnie Majeczka ma 7 miesięcy i 3 tygodnie. Naczyniak na łuku brwiowym rośnie i coraz bardziej uwypukla się co zreszta chyba widac na zdięciach.'),(61,'Naczyniak na uszku, Zosia',''),(63,'Marek',''),(64,'naczyniaczek córcia ania_p100',''),(70,'MAJA - naczyniak ślinianki przyusznej.','naczyniak limfatyczno krwionośny'),(69,'NACZYNIAKI LIMFATYCZNE I PODOBNE',''),(71,'Nadia - duzy naczyniak z boku na tulowiu',''),(72,'mocno owrzodzony naczyniak uda',''),(73,'Hubert u którego zdiagnozowano naczyniaka jamistego w wardze górnej, prawym policzku oraz w części podżuchwowej',''),(74,'córcia Juti - Naczyniak ślinianki przyusznej o echu mieszanym',''),(75,'Natalia naczyniak policzka nachodzący na oczko',''),(76,'Izabelka nacz. noska - córcia karaska30','Iza urodziła się z mała czerwoną plamką na nosku, w ciągu dwóch miesięcy naczyniak gwałtownie się rozrósł, rósł do 2 roku życia ( niestety nie mamy zdjęć z tego okresu w wersjii cyfrowej), nosek był bardzo napuchnięty i miał kolor bordowy. Około 2,5 lat zacząl się nieznacznie wchłaniać. W chwili obecnej opuchlizna zeszła, naczynik zmienił barwę na kolor różowy, ale nadal zajmuje praktycznie całą powierzchnię noska córeczki i go zniekształca'),(77,'Michałek synek green40 n.na główce',''),(78,'Natalia córcia mag-n, nacz. pod oczkiem',''),(79,'córcia iwcia, naczyniak policzka w fazie wzrostu',''),(80,'Franciszek syn Tabasco_girl, naczyniak na nosku',''),(81,'córcia  kina82, naczyniak na nóżce','wrzodziejący naczyniak'),(82,'lena córcia majka 7501, n. za uszkiem',''),(83,'Marta córcia gabrieli, n. na twarzy',''),(86,'Emilka córcia Lewar, ,n. na czole',''),(88,'Maja, córcia asiakazik',''),(89,'Maja, córcia padopa123, n. na twarzy',''),(90,'córcia pogus, naczyniak na dolnej powiece',''),(91,'Córcia milarz, n. na piersi',''),(92,'synek Kamil15044, rozległy naczyniak na twarzy',''),(93,'córcia kordylka, n. na twarzy',''),(94,'Ola, córcia luizalabencka, n. na policzku',''),(95,'córc